import "./Header.scss";
import logo from '../../assets/images/rikakumalogo.JPG';

const Header = () => {
  return (
    <div className="header">
      <div className="header__logo">
        <img src={logo} alt="logo pic" />
      </div>
    </div>
  );
};
export default Header;
